 *     ListNode(int x, ListNode *next) : val(x), next(next) {}
 * };
 */
class Solution {
public:
    vector<int> nodesBetweenCriticalPoints(ListNode* head) {
        if(head == NULL || head->next == NULL || head->next->next == NULL)
            return {-1, -1};
        int first = -1, last = -1, minVal = INT_MAX, maxVal = INT_MIN;
        ListNode* prev = head;
        head = head->next;
        for(int i = 1; head->next != NULL; i++) {
            if((prev->val < head->val && head->val > head->next->val) ||
               (prev->val > head->val && head->val < head->next->val)) {
                if(first == -1)
                    first = i;
                last = i;
                minVal = min(minVal, last - first);
                maxVal = max(maxVal, last - first);
            }
            prev = head;
            head = head->next;
        }
        if(minVal == INT_MAX)
            return {-1, -1};
        return {minVal, maxVal};
    }
};
